import React, { Component } from 'react'

export default class PastTrip extends Component {

    state = {
        tripList: [],
        userID: ''
    }

    componentDidMount() {
        const {trips, id} = this.props.currentUser

        try {
            this.setState({
                tripList: trips,
                userID: id
            })

          } catch (err) {
            console.log(err);
          }

    }

    render() {

        const {tripList, userID} = this.state

        console.log(tripList, userID)

        return (
            <div>
                hellos
            </div>
        )
    }
}
